package solutions.a2.cdc.oracle.internals;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;
import static solutions.a2.oracle.utils.BinaryUtils.hexToRaw;

import org.junit.jupiter.api.Test;

/**
 *  
 * @author <a href="mailto:averemee@a2.solutions">Aleksei Veremeev</a>
 * 
 */
public class Op19_1_IdxObj16334300_Test {

	@Test
	public void test() {

		OraCdcRedoLog orl = OraCdcRedoLog.getLinux19c();
		
		byte[] baColb = hexToRaw("");
		OraCdcRedoRecord rrColb = new OraCdcRedoRecord(orl, 0xD05E761B454L, "0x003654.00034799.0010", baColb);

		assertFalse(rrColb.has5_1());
		assertTrue(rrColb.hasColb());
		assertFalse(rrColb.hasKrvDlr10());
		assertEquals(rrColb.changeColb().obj(), 16334300);
		assertEquals(rrColb.changeColb().conId(), 0);

		System.out.println(rrColb);

	}
}
